import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import LogItem from "../log-item";

const GroupedLog = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const jalali = require('moment-jalaali');
    const moment = require('persian-date');
    const orgMoment = require('moment');
    const selectedLogContact = useSelector(state => state.selectedLogContact);

    const _renderLogs = (group) => {
        console.log("cdrsData", cdrsData)
        return Object
            .keys(group)
            .map((key, index) => (
                <div key={index}>
                    <p>{key.replace('Logs', '')}</p>
                    {group[key].map((item, i) => (
                        <LogItem item={item} key={i}/>
                    ))}
                </div>
            ));
    };
    const clearDuplicates = (group) => {
        return Object
            .keys(group)
            .map((key, index) => {
                    for (let i = 0; i < group[key].length; i++) {
                        let current = group[key][i];
                        console.log("current", current)
                        console.log("group[key]", group[key])

                        const item = group[key].filter(i => i.direction === current.direction && i.from === current.from)
                        console.log("item", item.length)
                        // if (group[key][i].direction === "outbound" && current.from === group[key][i].from) {
                        //     console.log("group[key][i]", group[key][i]);
                        //     num++
                        //     console.log("count", count);
                        //
                        // }
                    }
                    // console.log(group[key])
                }
            )
    }

    return (
        <React.Fragment>
            {
                _renderLogs(cdrsData)
            }
            {
                clearDuplicates(cdrsData)
            }
        </React.Fragment>
    );

};


export default GroupedLog;
